Deadline LIVE with Jack Blood

05/06/2010 Thursday 
-------------------

Jack starts out covering the topics of the day. After the news Jack is joined by Hank Albarelli for part 2 (allegedly). Hank joins in about 10 minutes into the show and is on for the remainder. You can find info on Hank at http://www.albarelli.net/index.html. His latest book is A Terrible Mistake.

